    public class FloatNumericUpDown : NumericUpDown
    {
        public FloatNumericUpDown()
        {
            DecimalPlaces = 2; // Set the desired number of decimal places
        }

        protected override void ValidateEditText()
        {
            // Allow parsing of floating-point values
            if (decimal.TryParse(Text, out decimal result))
            {
                if (result < Minimum)
                    result = Minimum;
                else if (result > Maximum)
                    result = Maximum;
                Value = result;
            }
            else
            {
                // If parsing fails, reset the control to the previous valid value
                Text = Value.ToString();
            }
        }
    }

